import React from 'react';
// import './MainButton.css'; 

// function MainButton(){text, onClick} {
export const MainButton = ({text}) => {
  function clickHandler() {
    console.log('Button Clicked')
  }

  return (
    <div>
      <button onClick={clickHandler}>
        {text}
      </button>
    </div>
  );
}

